  connect(node) {

    if (this.source) {
      this.disconnect();
    }

    this.source = node;
    this.source.connect(this.analyser);

    this.render();
  }

  /**
  Stop visualizing the source node and disconnect it.
  */
  disconnect() {
    if (this.source) {
      this.source.disconnect(this.analyser);
      this.source = null;
    }

  }

  click() {
